benchmarks.Subscriptions.time_subscripti.code:
class Subscriptions:
    def time_subscription(self):
        s = """
        subscription {
            something
        }
        """

        async def _run():
            for _ in range(100):
                iterator = await schema.subscribe(s)

                value = await iterator.__anext__()

                assert value.data["something"] == "Hello World!"

        asyncio.run(_run())
